'1,2,3,4,5',1,'2016-04-18 10:10:58'),(36,3,'¿En esta materia fue clara la forma de evaluación?','G',14,'SS','1,2,3,4,5',2,'2016-04-18 10:11:25'),(37,3,'¿El maestro las motiva constantemente para tener un mejor desempeño? ','G',17,'SS','1,2,3,4,5',1,'2016-04-18 10:15:48'),(38,3,'¿Las metas que pone el maestro son retadoras pero al mismo tiempo alcanzables? ','G',17,'SS','1,2,3,4,5',2,'2016-04-18 10:16:07'),(39,3,'¿En el salón de clases se atienden las necesidades de cada una de las alumnas? ','G',18,'SS','1,2,3,4,5',1,'2016-04-18 10:17:25'),(40,3,'¿Sientes que el maestro reconoce tus logros y tus dificultades? ','G',18,'SS','1,2,3,4,5',2,'2016-04-18 10:17:42'),(41,3,'¿El maestro fomenta la participación y eres escuchada y tomada en cuenta? ','G',20,'SS','1,2,3,4,5',1,'2016-04-18 10:19:18'),(42,3,'¿El maestro genera experiencias para colaborar y trabajar en equipo durante el curso? ','G',20,'SS','1,2,3,4,5',2,'2016-04-18 10:19:43'),(43,3,'¿Le tienes confianza al maestro para expresarle tus dudas, Preguntas y sugerencias?','G',21,'SS','1,2,3,4,5',1,'2016-04-18 10:23:08'),(44,3,'¿Cuándo tienes una dificultad el maestro te apoya? ','G',21,'SS','1,2,3,4,5',2,'2016-04-18 10:23:42'),(45,3,'¿El salón de clases es un espacio seguro donde no son permitidas las agresiones de ningún tipo?','G',22,'SS','1,2,3,4,5',1,'2016-04-18 10:24:47'),(46,3,'¿En el salón de clases te sientes respetada por el maestro? ','G',22,'SS','1,2,3,4,5',2,'2016-04-18 10:25:10'),(47,3,'¿Formas parte del grupo y te sientes integrada?','G',22,'SS','1,2,3,4,5',3,'2016-04-18 10:25:22'),(48,3,'¿El maestro consigue que esta materia te interese?','G',23,'SS','1,2,3,4,5',1,'2016-04-18 10:28:48'),(49,3,'¿El maestro es entusiasta y emprendedor con respecto a su materia?','G',23,'SS','1,2,3,4,5',2,'2016-04-18 10:29:10'),(50,3,'¿El maestro contribuye con la limpieza y orden del salón?','G',24,'SS','1,2,3,4,5',1,'2016-04-18 10:30:49'),(51,3,'¿El maestro optimiza los espacios - mueve las bancas, abre ventanas, ilumina, utiliza las paredes para pegar cosas- para favorecer el aprendizaje?','G',24,'SS','1,2,3,4,5',2,'2016-04-18 10:31:16'),(52,4,'El maestro diseña su curso con base al momento de desarrollo de las alumnas, el mapa de contenidos, el programa de estudios y la transversalidad.','G',25,'SS','6,7,8,9,10',1,'2016-05-27 10:51:52'),(53,4,'El maestro planea e imparte las clases de manera estructurada, de acuerdo a la metodología clase sagrado corazón incluyendo un encuadre inicial y brindando instrucciones claras para cada actividad.','G',25,'SS','6,7,8,9,10',2,'2016-05-27 10:51:52'),(54,4,'El maestro es intencional en el desarrollo de los macro procesos de pensamiento en el diseño de sus clases.','G',25,'SS','6,7,8,9,10',3,'2016-05-27 11:04:53'),(55,4,'El maestro ajusta el programa y las lecciones al reto que cada grupo requiere para sentirse motivado.','G',26,'SS','6,7,8,9,10',1,'2016-05-27 11:08:33'),(56,4,'El maestro revisa conocimientos previos y ajusta el punto de partida de cada nueva lección de acuerdo al nivel del grupo. ','G',26,'SS','6,7,8,9,10',2,'2016-05-27 11:09:14'),(57,4,'El maestro utiliza una variedad de estrategias de enseñanza para favorecer la comprensión y mantener a las alumnas involucradas en la tarea.','G',27,'SS','6,7,8,9,10',1,'2016-05-27 11:10:03'),(58,4,'El maestro aplica la mediación para promover un aprendizaje significativo.','G',27,'SS','6,7,8,9,10',2,'2016-05-27 11:10:42'),(59,4,'El maestro maneja el error como fuente de aprendizaje.','G',27,'SS','6,7,8,9,10',3,'2016-05-27 11:11:03'),(60,4,'El maestro establece límites claros y consecuencias de comportamiento. ','G',28,'SS','6,7,8,9,10',1,'2016-05-27 11:13:48'),(61,4,'El maestro regula la conducta y resuelve los conflictos que se presentan en el grupo.','G',28,'SS','6,7,8,9,10',2,'2016-05-27 11:14:31'),(62,4,'El maestro reconoce y refuerza el buen comportamiento. ','G',28,'SS','6,7,8,9,10',3,'2016-05-27 11:14:49'),(63,4,'El maestro inicia y termina cada clase de manera puntual, utilizando el tiempo de manera efectiva.','G',29,'SS','6,7,8,9,10',1,'2016-05-27 11:19:53'),(64,4,'El maestro atiende de manera equitativa a todas las alumnas.','G',29,'SS','6,7,8,9,10',2,'2016-05-27 11:20:13'),(65,4,'El maestro utiliza efectivamente distintos recursos didácticos, incluyendo el uso de las TIC','G',29,'SS','6,7,8,9,10',3,'2016-05-27 11:20:33'),(66,4,'El maestro aplica una variedad de estrategias de evaluación (incluyendo la autoevaluación y coevaluación)','G',30,'SS','6,7,8,9,10',1,'2016-05-27 11:21:49'),(67,4,'El maestro brinda retroalimentación objetiva y oportuna al grupo y a las alumnas.','G',30,'SS','6,7,8,9,10',2,'2016-05-27 11:22:22'),(68,4,'El maestro solicita tareas pertinentes para el proceso de aprendizaje.','G',31,'SS','6,7,8,9,10',1,'2016-05-27 11:23:41'),(69,4,'El maestro revisa las tareas de manera consistente y oportuna para construir el aprendizaje. ','G',31,'SS','6,7,8,9,10',2,'2016-05-27 11:23:54'),(70,4,'El maestro aplica en cada clase la secuencia de entrada, elaboración y salida.','G',32,'SS','6,7,8,9,10',1,'2016-05-27 11:24:19'),(71,4,'El maestro consigue que la clase sea fluida y equilibrada en cuanto al tipo de actividades.','G',32,'SS','6,7,8,9,10',2,'2016-05-27 11:24:38'),(72,4,'El profesor propicia la elaboración de síntesis, conclusiones  y principios.','G',32,'SS','6,7,8,9,10',3,'2016-05-27 11:24:53'),(73,4,'El profesor verifica la comprensión de conceptos y transferencia a la vida real.','G',32,'SS','6,7,8,9,10',4,'2016-05-27 11:25:17'),(74,4,'El profesor revisa el proceso metacognitivo.','G',32,'SS','6,7,8,9,10',5,'2016-05-27 11:25:37'),(77,1,'¿Entiendes a la maestra cuando explica un tema? ','G',1,'SS','1,2,3,4,5',5,'2016-06-27 16:33:07'),(78,1,'¿Sabes por qué es importante el tema que están viendo? ','G',1,'SS','1,2,3,4,5',6,'2016-06-27 16:33:44'),(79,1,'¿Conoces las reglas de comportamiento dentro del salón de clases? ','G',2,'SS','1,2,3,4,5',3,'2016-06-27 16:35:04'),(80,1,'¿Tu maestra aplica las reglas cuando alguien no se está portando bien? ','G',2,'SS','1,2,3,4,5',4,'2016-06-27 16:35:18'),(81,1,'¿Tu maestra te motiva para esforzarte al máximo? ','G',3,'SS','1,2,3,4,5',3,'2016-06-27 16:35:58'),(82,1,'¿Tu maestra te pone retos para que cada vez lo hagas mejor? ','G',3,'SS','1,2,3,4,5',4,'2016-06-27 16:36:11'),(83,1,'¿Crees que tu maestra le presta atención a quien más lo necesita? ','G',4,'SS','1,2,3,4,5',3,'2016-06-27 16:36:39'),(84,1,'¿Sientes que tu maestra reconoce tus logros y tus dificultades? ','G',4,'SS','1,2,3,4,5',4,'2016-06-27 16:37:00'),(85,1,'¿Tu maestra te escucha y te toma en cuenta? ','G',5,'SS','1,2,3,4,5',3,'2016-06-27 16:37:25'),(86,1,'¿Hay momentos para trabajar en equipo durante esta clase? ','G',5,'SS','1,2,3,4,5',4,'2016-06-27 16:37:37'),(87,1,'¿Te sientes en confianza en clase para hacer Preguntas a la maestra?  ','G',6,'SS','1,2,3,4,5',3,'2016-06-27 16:38:07'),(88,1,'¿Tu maestra está cerca de ti cuando tienes un logro importante o cuando fallas en algo? ','G',6,'SS','1,2,3,4,5',4,'2016-06-27 16:38:46'),(89,1,'¿Te sientes segura en el salón de clases porque sabes que nadie te va a molestar o lastimar?  ','G',7,'SS','1,2,3,4,5',3,'2016-06-27 16:39:10'),(90,1,'¿Tu maestra y tus compañeras te respetan? ','G',7,'SS','1,2,3,4,5',4,'2016-06-27 16:39:35'),(91,1,'¿Te gusta lo que aprendes en la escuela? ','G',8,'SS','1,2,3,4,5',3,'2016-06-27 16:40:06'),(92,1,'¿Crees que tu maestra explica los temas de manera interesante y atractiva? ','G',8,'SS','1,2,3,4,5',4,'2016-06-27 16:40:24'),(93,1,'¿Tu maestra mantiene el salón de clases limpio y ordenado, para que todas nos sintamos a gusto para trabajar mejor? ','G',9,'SS','1,2,3,4,5',3,'2016-06-27 16:41:00'),(94,1,'¿Tu maestra hace cambios en el salón –mueve las bancas, abre ventanas, ilumina, utiliza las paredes para pegar cosas— para favorecer el aprendizaje?','G',9,'SS','1,2,3,4,5',4,'2016-06-27 16:41:34');
